import Vue from 'vue'
import VueRouter from 'vue-router'
import HowItWorks from '../views/HowItWorks'
import BecomeAPartner from '../views/BecomeAPartner'
import AboutUs from '../views/AboutUs'

Vue.use(VueRouter)

const routes = [
  {
    path: '/home',
    name: 'home',
    component: () => import(/* webpackChunkName: "home" */ '../views/HomeView.vue'),
    // component: HomeView
  },
  {
    path: '/how-it-works',
    name: 'how-it-works',
    component: () => import(/* webpackChunkName: "home" */ '../views/HowItWorks.vue'),
  },
  {
    path: '/becomea-partner',
    name: 'becomeapartner',
    component: () => import(/* webpackChunkName: "home" */ '../views/BecomeAPartner.vue'),
  },
  {
    path: '/about-us',
    name: 'about-us',
    component: () => import(/* webpackChunkName: "home" */ '../views/AboutUs.vue'),
  }
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router
